import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";

const SearchResult = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div style={{display: 'flex', flexDirection: 'column', alignItems: 'center', backgroundColor: '#f4f4f4', padding: '50px 0'}}>
            <h1 style={{fontSize: '32px', margin: '20px 0', color: '#5c5c5c'}}>{mydata.searchname}</h1>
            <img
                src={mydata.thumbnail}
                alt={mydata.searchname}
                style={{width: '40%', marginBottom: '10px', borderRadius: '3px', boxShadow: '0px 5px 10px rgba(0, 0, 0, 0.1)'}}/>
            <p style={{fontSize: '18px', textAlign: 'center', maxWidth: '600px', color: '#5c5c5c'}}>
                {mydata.abstract}
            </p>
            <h2 style={{fontSize: '24px', margin: '20px 0', color: '#5c5c5c'}}>
                Books:
            </h2>
            <ul style={{listStyle: 'none', paddingLeft: 0, margin: 0}}>
                {mydata.book.map((book) => (
                    <li key={book} style={{fontSize: '18px', marginBottom: '10px', color: '#5c5c5c'}}>
                        {book}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default SearchResult;
